'%{
\n\n\nStart\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen a colleague at Brandeis died suddenly of a heart attack, Morrie went to his funeral. He came home depressed. “What a waste,” he said. “All those people saying all those wonderful things, and Irv never got to hear any of it.” Morrie had a better idea. He made some calls. He chose a date. And on a cold Sunday afternoon, he was joined in his home by a small group of friends and family for a “living funeral.” Each of them spoke and paid tribute to my old professor. Some cried. Some laughed. One woman read a poem:\n\nJanuary 12, 2016\n\u001c13\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI did not keep in touch. In fact, I lost contact with most of the people I knew in college, including my beer-drinking friends and the first woman I ever woke up with in the morning. The years after graduation hardened me into someone quite different from the strutting graduate who left campus that day headed for New York City, ready to offer the world his talent.\n\nJanuary 12, 2016\n\u001c15\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLearn to forgive yourself and to forgive others” “Don’t assume that it’s too late to get involved.”\n\nJanuary 12, 2016\n\u001c18\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI did what I had become best at doing: I tended to my work, even while my dying professor waited on his front lawn. I am not proud of this, but that is what I did\n\nDon\u0027t do this with Dominic\n\nJanuary 12, 2016\n\u001c23\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMorrie might have died without ever seeing me again. I had no good excuse for this, except the one that everyone these days seems to have. I had become too wrapped up in the siren song of my own life. I was busy.\n\nJanuary 12, 2016\n\u001c26\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLiving unhappily is something else. So many of the people who come to visit me are unhappy.” Why? “Well, for one thing, the culture we have\n\nJanuary 12, 2016\n\u001c28\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cdoes not make people feel good about themselves. We’re teaching the wrong things. And you have to be strong enough to say if the culture doesn’t work, don’t buy it. Create your own. Most people can’t do it. They’re more unhappy than me—even in my current condition.\n\nJanuary 12, 2016\n\u001c28\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOne afternoon, I am complaining about the confusion of my age, what is expected of me versus what I want for myself. “Have I told you about the tension of opposites?” he says. The tension of opposites? “Life is a series of pulls back and forth. You want to do one thing, but you are bound to do something else. Something hurts you, yet you know it shouldn’t. You take certain things for granted, even when you know you should never take anything for granted. “A tension of opposites, like a pull on a rubber band. And most of us live somewhere in the middle.” Sounds like a wrestling match, I say. “A wrestling match.” He laughs. “Yes, you could describe life that way.” So which side wins, I ask?\n\nJanuary 12, 2016\n\u001c30\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhich side wins?” He smiles at me, the crinkled eyes, the crooked teeth. “Love wins. Love always wins.”\n\nJanuary 12, 2016\n\u001c30\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMorrie, true to these words, had developed his own culture—long before he got sick. Discussion groups, walks with friends, dancing to his music in the Harvard Square church. He started a project called Greenhouse, where poor people could receive mental health services. He read books to find new ideas for his classes, visited with colleagues, kept up with old students, wrote letters to distant friends. He took more time eating and looking at nature and wasted no time in front of TV sitcoms or “Movies of the Week.” He had created a cocoon of human activities—conversation, interaction, affection—and it filled his life like an overflowing soup bowl.\n\nJanuary 12, 2016\n\u001c32\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cmeaning into your life is to devote yourself to loving others, devote yourself to your community around you, and devote yourself to creating something that gives you purpose and meaning.” I knew he was right.\n\nJanuary 12, 2016\n\u001c32\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1g46bJsiEGbAGsjCVMtQt3eXaLSf6J2aX_VTxWLo","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"12JaGMdt6SUPboTj09I7m4132KBxUxqgFvKyMZTo","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},