_fgc_i":false,"ts_va":"nor","ts_va_i":false}},{"ty":"as","st":"text","si":3219,"ei":3873,"sm":{"ts_ff_i":false,"ts_va":"nor","ts_it":true,"ts_va_i":false,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":3874,"ei":3891,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":3892,"ei":3909,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}},{"ty":"as","st":"text","si":3910,"ei":4119,"sm":{"ts_ff_i":false,"ts_va":"nor","ts_it":true,"ts_va_i":false,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":4120,"ei":4137,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":4138,"ei":4143,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="2SvXuAKmA4zBlEuD7RZqwVbXwVE"  nonce="2SvXuAKmA4zBlEuD7RZqwVbXwVE">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="2SvXuAKmA4zBlEuD7RZqwVbXwVE"  nonce="2SvXuAKmA4zBlEuD7RZqwVbXwVE">DOCS_modelChunk = [{"ty":"is","ibi":4144,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe speaks of the alienation of youth and the need for “connectedness” with the society around me. Some of these things I under stand, some I do not. It makes no difference. The discussions give me an excuse to talk to him, fatherly conversations I cannot have with my own father, who would like me to be a lawyer.\n\nJanuary 12, 2016\n\u001c34\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe most important thing in life is to learn how to give out love, and to let it\n\nJanuary 12, 2016\n\u001c38\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ccome in.” His voice dropped to a whisper. “Let it come in. We think we don’t deserve love, we think if we let it in we’ll become too soft. But a wise man named Levine said it right. He said, ‘Love is the only rational act.’”\n\nJanuary 12, 2016\n\u001c38\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMitch, I don’t allow myself any more self-pity than that. A little each morning, a few tears, and that’s all.” I thought about all the people I knew who spent many of their waking hours feeling sorry for themselves. How useful it would be to put a daily limit on self-pity. Just a few tearful minutes, then on with the day. And if Morrie could do it, with such a horrible disease… “It’s only horrible if you see it that way,” Morrie said. “It’s horrible to watch my body slowly wilt away to nothing. But it’s also wonderful because of all the time I get to say good-bye.” He smiled. “Not everyone is so lucky\n\nJanuary 12, 2016\n\u001c41\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe all need teachers in our lives.\n\nJanuary 14, 2016\n\u001c45\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA teacher affects eternity; he can never tell where his influence stops.” — HENRY ADAMS\n\nJanuary 14, 2016\n\u001c54\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJanuary 14, 2016\n\u001c56\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe really don’t experience the world fully, because we’re half-asleep, doing things we automatically think we have to do.” And facing death changes all that? “Oh, yes. You strip away all that stuff and you focus on the essentials. When you realize you are going to die, you see everything much differently. He sighed. “Learn how to die, and you learn how to live.”\n\nJanuary 14, 2016\n\u001c56\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWell, the truth is, if you really listen to that bird on your shoulder, if you accept that you can die at any time— then you might not be as ambitious as you are.” I forced a small grin. “The things you spend so much time on—all this work you do—might not seem as important. You might have to make room for some more spiritual things.”\n\nJanuary 14, 2016\n\u001c57\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe fact is, there is no foundation, no secure ground, upon which people may stand today if it isn’t the family. It’s become quite clear to me as I’ve been sick. If you don’t have the support and love and caring and concern that you get from a family, you don’t have much at all. Love is so supremely important. As our great poet Auden said, ‘Love each other or perish.’”\n\nJanuary 14, 2016\n\u001c62\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat she mostly wanted, he learned, was the same thing many people want—someone to notice she was there.\n\nJanuary 17, 2016\n\u001c73\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe smiled. “You know what that reflects? Unsatisfied lives. Unfulfilled lives. Lives that haven’t found meaning. Because if you’ve found meaning in your life, you don’t want to go back. You want to go forward. You want to see more, do more. You can’t wait until sixty-five.\n\nJanuary 17, 2016\n\u001c79\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThey were embracing material things and expecting a sort of hug back. But it never works. You can’t substitute material things for love or for gentleness or for tenderness or for a sense of comradeship. “Money is not a substitute for tenderness, and power is not a substitute for tenderness. I can tell you, as I’m sitting here dying, when you most need it, neither money nor power will give you the feeling you’re looking for, no matter how much of them you have.”\n\nJanuary 17, 2016\n\u001c83\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOffering others what you have to give.” You sound like a Boy Scout. “I don’t mean money, Mitch. I mean your time. Your concern. Your storytelling. It’s not so hard. There’s a senior center that opened near here. Dozens of elderly people come there every day. If you’re a young man or young woman and you have a skill, you are asked to come and teach it. Say you know computers. You come there and teach them computers. You are very welcome there. And they are very grateful. This is how you start to get respect, by offering something that you have. “There are plenty of places to do this. You don’t need to have a big talent. There are lonely people in hospitals and shelters who only want some companionship. You play cards with a lonely older man and you find new respect for yourself, because you are needed.\n\nJanuary 17, 2016\n\u001c84\n\u0011\n\u0011"},{"ty":"te","id":"i.12","spi":4153},{"ty":"te","id":"i.13","spi":4504},{"ty":"te","id":"i.14","spi":4622},{"ty":"te","id":"i.15","spi":4884},{"ty":"te","id":"i.16","spi":5530},{"ty":"te","id":"i.17","spi":5602},{"ty":"te","id":"i.18","spi":5727},{"ty":"te","id":"i.19","spi":5763},{"ty":"te","id":"i.20","spi":6165},{"ty":"te","id":"i.21","spi":6538},{"ty":"te","id":"i.22","spi":6947},{"ty":"te","id":"i.23","spi":7089},{"ty":"te","id":"i.24","spi":7400},{"ty":"te","id":"i.25","spi":7903},{"ty":"as","st":"paragraph","si":4144,"ei":4144,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":4145,"ei":4145,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i