” he added, grinning, “there’s nothing in there about a salary.”\n\nJanuary 17, 2016\n\u001c84\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJanuary 17, 2016\n\u001c90\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut really listening to someone—without trying to sell them something, pick them up, recruit them, or get some kind of status in return—how often do we get this anymore?\n\nJanuary 17, 2016\n\u001c91\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThey don’t know what they want in a partner. They don’t know who they are themselves—so how can they know who they’re marrying?\n\nJanuary 17, 2016\n\u001c97\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLook, no matter where you live, the biggest defect we human beings have is\n\nJanuary 31, 2016\n\u001c102\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cour shortsightedness. We don’t see what we could be.\n\nJanuary 31, 2016\n\u001c102\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe should be looking at our potential, stretching ourselves into everything we can become.\n\nJanuary 31, 2016\n\u001c102\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn the beginning of life, when we are infants, we need others to survive, right? And at the end of life, when you get like me, you need others to survive, right?” His voice dropped to a whisper. “But here’s the secret: in between, we need others as well.”\n\nJanuary 31, 2016\n\u001c103\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJune 13, 2017\n\u001c105\n\u0011\n\u0011"}
}'


